import React from 'react';
import "./Services.css";

function Services(props) {
    return(
        <div>
        <div>
            <p className = "exterior">Single Exterior doors</p>
        </div>
        <div>
            <img className = "glass" src = "./Images/Glassdoor.jpg" alt = "Glass Door" />
            <img className ="door" src = "./Images/exterior.jpg" alt =" Exterior Door" />
            <img className = "Brown" src = "./Images/Brown.jpg" alt = "Brown Door" />
        </div>
        </div>
    )
}

export default Services;
